const SignUpSideBar = () => {
    return (
        <div id = "SignUpSideBar">
            <img id = "SideBarLogo" src = "https://i.imgur.com/qajrJEV.png" />
            <img id = "SideBarImage" src = "https://i.imgur.com/lCxkPiY.png" />
        </div>
    );
}

